css:
@-moz-document 
url-prefix("https://google.com/accounts/ServiceLogin?service="),
url-prefix("https://accounts.google.com/ServiceLogin?service="),
url-prefix("https://accounts.google.com/Login")
{

html, .signin-box, .accountchooser-box, .main
{background: #000 !important; border: none !important}

.google-header-bar, .announce-bar, .google-footer-bar, .product-info, #signIn
{display: none !important}

.sign-in, .remember
{float: none !important; margin: 9px auto !important}

#Email, #Passwd, .reauth
{color: #4db339 !important; background-color: #000 !important}
h1,h2,h3,h4,h5,h6, strong
{color: #A2A2A2 !important}
a
{color: #cf5 !important}

input[type="email"]:focus, input[type="password"]:focus, input[type="text"]:focus, input[type="url"]:focus
{border-color: #d9d9d9 !important}
}

@-moz-document
url("http://www.google.com/mail/help/logout.html"),
url("https://www.google.com/mail/help/logout.html")
{
.aside
{float: none !important; margin: 20px auto !important;
 border-color: #063 !important}
.header, .masthead, .features
{display: none !important}
body {background-color: #000 !important}
}

@-moz-document
url-prefix("https://google.com/accounts/ServiceLogin?service=mail"),
url-prefix("https://accounts.google.com/ServiceLogin?service=mail")
{
.signin-box h2 strong
{background: transparent url(data:image/png;base64,)
 no-repeat !important; 
 width: 0px !important; height: 0 !important;
 padding: 20px 60px !important;}
}

@-moz-document
url-prefix("https://google.com/accounts/ServiceLogin?service=grandcentral"),
url-prefix("https://accounts.google.com/ServiceLogin?service=grandcentral")
{
.signin-box h2 strong
{background: transparent url(data:image/png;base64,)
 no-repeat !important; 
 width: 0px !important; height: 0 !important;
 padding: 100px 75px !important;
 top: -50px !important}
}
